    const {data} = useQuery(["Weather"],() => {
        Axios.get(`https://api.openweathermap.org/data/2.5/weather?q=${city}&units=metric&appid={17cbc23e645646cd67cb8feea34b40f0
    }`).then((res) => {res.data})
    })
    return (
        <div className="main">
            <div className="temperature">
                <div>
                    {data}
